import styled from 'styled-components'
import Image from 'next/image'

const HomeContainer = () => {

    return (
        <Container>
            <h1>teste</h1>
            <Image
                src="/coding.png"
                width="100"
                height="100"
            />
        </Container>
    )

}

const Container = styled.div`
    display: flex;
    flex-direction: column;
`

export default HomeContainer
